import React from "react";
import "../Css/Navbar.css";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="nav">
      <div className="nav-left">
        <img src="/logo.png" alt="AgroLink Logo" className="logo" />
        <h2 className="brand">AgroLink</h2>
      </div>

      <ul className="nav-menu">
        <li>Marketplace</li>
        <li>Inputs</li>
        <li>Loans</li>
        <li>Insurance</li>
        <li>Impact</li>
        <li>Contact</li>
      </ul>

      <div className="nav-btns">
        <Link to="/signup">
          <button className="signup">Sign Up</button>
        </Link>

        <Link to="/login">
          <button className="login">Log In</button>
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
